const diseasesData = {
    "Healthy": {
      description: "This prawn is healthy and free from any diseases.",
      tips: [
        "Maintain good water quality.",
        "Provide a balanced diet to the prawns.",
        "Ensure proper aeration in the pond.",
        "Monitor for any abnormal behavior regularly."
      ]
    },
    "Black Gill": {
      description: "Black Gill Disease in prawns is caused by poor water quality or infections, leading to darkened gills and respiratory problems.",
      tips: [
        "Regularly check water quality and aeration.",
        "Use probiotics to prevent bacterial infections.",
        "Remove any infected prawns immediately.",
        "Avoid overcrowding in the pond."
      ]
    },
    "White Spot Disease": {
      description: "White Spot Disease (WSD) is caused by a virus that results in white spots on the prawn's body, leading to lethargy and high mortality.",
      tips: [
        "Use SPF (Specific Pathogen-Free) shrimp.",
        "Maintain optimal water quality.",
        "Disinfect all equipment and water sources.",
        "Remove infected shrimp immediately to prevent spread."
      ]
    }
  };
  
  export default diseasesData;
